'use strict';(function(){const indexCfg={cache:true};indexCfg.doc={id:'id',field:['title','content'],store:['title','href','section'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/docs/docs/basics/creating-a-project/','title':"Creating a project",'section':"Getting Started",'content':"Creating a Project #  On the landing page of Cute Exporter, click Create Project.\nChoose where you would like to save your project file. The same folder as your raw PSD or Asesprite assets is a good place. By default it will be named assets.db but you can name it whatever you want.\nThe project file can be saved anywhere but all the assets you add to your project will be referenced relative to where your project file is saved.\n The project file is an sqlite database file. You can read more about that here.  Next Up Adding Files\n"});index.add({'id':1,'href':'/docs/docs/basics/adding-files/','title':"Adding files",'section':"Getting Started",'content':"Adding Files to your project #  After creating a project you should add some files to it. Supported files types are:\n Photoshop files (.psd) Aseprite files (.ase or .aseprite) PNG (.png) JPEG (.jpeg)  To add a file go to your your project main page and cick Add File.\nIf you aren\u0026rsquo;t on your homepage click on the Files button on the left sidebar  Alternatively, on your project main page, you can drag and drop and supported file type into the Cute Exporter window.\nYour project can contain any mix of file types. Cute Exporter will export them all into a single texture atlas.\nNext up: Previewing Your Texture Atlas\n"});index.add({'id':3,'href':'/docs/docs/basics/previewing-texture-atlas/','title':"Previewing Texture Atlas",'section':"Getting Started",'content':"Previewing Your Texture Atlas #  You can preview what the resulting texture atlas of your project will look like at any time by clicking the Preview button on the top row of the app.\nThis preview will open a modal that display what your resulting texture atlas will look like when exported.\nThe preview is not to scale. You can see the final output size on the left side of the preview modal.  Up Next: Exporting\n"});})();